package com.liveeeasy.web.absorption.demo.spider.service.impl;import com.liveeeasy.web.absorption.demo.spider.dao.EstateDao;import com.liveeeasy.web.absorption.demo.spider.service.IEstateService;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;import java.util.List;import java.util.Map;@Servicepublic class EstateServiceImpl implements IEstateService {    @Autowired    private EstateDao estateDao;    @Override    public void batchInsert(List<Map<String, Object>> maps) {        if(maps.size() > 0) {            estateDao.batchInsert(maps);        }    }}